function App() {
  return (
    <div className="App">
      <Header />
      <IntroMe />
      <SecComponent topic= { "About me" }/>
      <AboutMe />
      <SecComponent topic= { "Projects" }/>
      <AboutMe />
      <SecComponent topic= { "Contact me" } />
      <ContactMe />
      <Footer />
    </div>
  );
}

export default App;
